import React, { Component, Fragment } from 'react';
import { Col, Container, Row } from 'react-bootstrap';

class Doctor extends Component {
    render() {
        return (
            <Fragment>
                <Container className="text-center mt-5">
                    <Row>
                        <Col lg={12} md={12} sm={12}>
                            <h1>Qualified Doctors</h1>
                            <h5>Separated they live in. A small river named Duden flows by their place and supplies it with the necessary regelialia. It is a paradisematic country</h5>
                        </Col>
                    </Row>
                    <Row>
                        <Col>
                            <h1>1</h1>
                        </Col>
                        <Col>
                            <h1>1</h1>
                        </Col>
                        <Col>
                            <h1>1</h1>
                        </Col>
                        <Col>
                            <h1>1</h1>
                        </Col>
                    </Row>
                </Container>
            </Fragment>
        );
    }
}

export default Doctor;
